<html>

<head>
	<title>Feedback</title>
	<style>
		* {
			box-sizing: border-box;
			font-family: "Helvetica Neue", "Segoe UI", "Roboto", "Droid Sans", sans-serif;
		}

		a {
			color: #A5243B;
		}

		.PageContainer {
			padding: 2%;
			display: flex;
			flex-direction: column;
			align-items: center;
		}

		.PageHeader {
			background-color: rgba(0, 0, 0, .05);
			;
			display: flex;
			flex-direction: row;
			justify-content: flex-start;
			align-items: center;
			text-align: center;
			margin: 0;
		}

		.PageHeading {
			display: flex;
			justify-content: center;
		}

		.btn-red {
			background-color: #A5243B;
			color: white;
			border: transparent;
			border-radius: 5px;
		}

		.btn-red:hover {
			background-color: #922935;
			color: white;
		}

		.btn-gray {
			background-color: #E5E5E5;
			color: black;
			border: 1px solid black;
			border-radius: 5px;
		}

		.btn-gray:hover {
			background-color: black;
			color: white;
		}

		tr:nth-child(odd) {
			background-color: #E5E5E5;
		}
	</style>
</head>
